// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract EthereumInsurance {
    address public owner;
    uint public ethPrice; // Placeholder for the Ethereum price, you need to update this value externally.
    uint256 public totalCoverageAmount;

    AggregatorV3Interface internal dataFeed;

    enum PolicyStatus { CREATED, CLAIM_MADE, EXPIRED}

    struct Policy {
        address insured;
        uint256 premium;
        uint256 coverageAmount;
        uint256 startDate;
        uint256 endDate;
        PolicyStatus status;
    }

    mapping(address => Policy) public policies;

    event PolicyPurchased(address indexed insured, uint256 premium, uint256 coverageAmount, uint256 startDate, uint256 endDate);
    event ClaimProcessed(address indexed insured, uint256 payoutAmount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    constructor() {
        dataFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        owner = msg.sender;
    }

    function purchaseInsurance(uint256 _durationDays) external payable {
        require(_durationDays <= 90, "Duration exceeds maximum of 3 months");

        uint256 premium = calculatePremium(_durationDays);
        require(msg.value == premium, "Incorrect premium amount sent");
        uint256 coverageAmount = premium * 2;
        require(coverageAmount + totalCoverageAmount <= address(this).balance, "Error! Insufficient fund for payout");

        totalCoverageAmount += coverageAmount;

        uint256 startDate = block.timestamp;
        uint256 endDate = startDate + (_durationDays * 1 days);

        Policy storage newPolicy = policies[msg.sender];
        newPolicy.insured = msg.sender;
        newPolicy.premium = premium;
        newPolicy.coverageAmount = coverageAmount; // Payout is double the premium
        newPolicy.startDate = startDate;
        newPolicy.endDate = endDate;
        newPolicy.status = PolicyStatus.CREATED;

        emit PolicyPurchased(msg.sender, premium, newPolicy.coverageAmount, startDate, endDate);
    }

    function calculatePremium(uint256 _durationDays) public pure returns (uint256) {
        // Simplified premium calculation logic, you might want to use more sophisticated algorithms
        // based on the duration, risk models, etc.
        return _durationDays * 0.001 ether; // Premium is proportional to the duration (1 ether per day)
    }

    function attemptClaim() external {
        Policy storage policy = policies[msg.sender];

        require(policy.insured == msg.sender, "No policy found for the sender");
        require(policy.status == PolicyStatus.CREATED, "Insurance already claimed");
        require(block.timestamp <= policy.endDate, "Policy expired");
        ethPrice = uint256(getEthPrice());
        require(ethPrice < 1000 * 1**getEthDecimalPlace(), "Ethereum price is not below $1000");

        // Perform claim processing logic...
        policy.status = PolicyStatus.CLAIM_MADE;

        // Example: Transfer double the premium amount as a payout
        totalCoverageAmount = totalCoverageAmount -= totalCoverageAmount; 
        payable(msg.sender).transfer(policy.coverageAmount);

        emit ClaimProcessed(msg.sender, policy.coverageAmount);
    }
    function fundContract() external payable {
    }
    function withdraw() payable public onlyOwner{
        address payable recipient = payable(msg.sender);
        recipient.transfer(address(this).balance);
    }
    function getContractBalance() view external onlyOwner() returns(uint256){
        return address(this).balance;
    }
    function getEthPrice() public view returns (int) {
        // prettier-ignore
        (
            /* uint80 roundID */,
            int answer,
            /*uint startedAt*/,
            /*uint timeStamp*/,
            /*uint80 answeredInRound*/
        ) = dataFeed.latestRoundData();
        return answer;
    }
    function getEthDecimalPlace() public view returns(uint){
        return dataFeed.decimals();
    }


}

